import React, {Component} from "react";
import slide1 from "../components/images/slide-1.png";
import slide2 from "../components/images/slide-2.jpeg";
import slide3 from "../components/images/slide-3.jpeg";
import slide4 from "../components/images/slide-4.jpg";
import slide5 from "../components/images/slide-5.jpeg";
import "../style/slider.css";
import { Carousel } from "bootstrap";

import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

export default function MainSlider() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 1500,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  return (
    <Slider {...settings}>
      <div>
      <img className="slide1" src={slide1} alt="slide1"></img>
        <h3>1</h3>
      </div>
      <div>
      <img className="slide1" src={slide1} alt="slide1"></img>
        <h3>2</h3>
      </div>
      <div>
      <img className="slide1" src={slide1} alt="slide1"></img>
        <h3>3</h3>
      </div>
      <div>
      <img className="slide1" src={slide1} alt="slide1"></img>
        <h3>4</h3>
      </div>
      <div>
      <img className="slide1" src={slide1} alt="slide1"></img>
        <h3>5</h3>
      </div>
      <div>
      <img className="slide1" src={slide1} alt="slide1"></img>
        <h3>6</h3>
      </div>
    </Slider>
  );
}


